import 'dart:async';

import 'package:flutter/material.dart';
import 'package:shared_preferences/shared_preferences.dart';
import 'package:tts06c1/Firebase/Authentication/login_screen.dart';
import 'package:tts06c1/Firebase/Authentication/user_dashboard.dart';


class SplashScreen extends StatefulWidget {
  const SplashScreen({super.key});

  @override
  State<SplashScreen> createState() => _SplashScreenState();
}

class _SplashScreenState extends State<SplashScreen> {


  void screenShifter()async{
    SharedPreferences userLogged = await SharedPreferences.getInstance();
    var userSession = userLogged.getString("userEmail");
    if(userSession != null ){
      Timer(Duration(milliseconds: 3000), () => Navigator.push(context, MaterialPageRoute(builder: (context) => UserDashBoard(),)),);
    }else{
      Timer(Duration(milliseconds: 3000), () => Navigator.push(context, MaterialPageRoute(builder: (context) => LoginScreen(),)),);
    }
  }

  @override
  void initState() {
    // TODO: implement initState
    screenShifter();
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: Center(
        child: Container(
          width: 200,
          height: 200,
          decoration: BoxDecoration(
            image: DecorationImage(
                fit: BoxFit.cover,
                image: NetworkImage('data:image/jpeg;base64,'))
          ),
        ),
      ),
    );
  }
}
